import './App.css';

const name = 0;
// const element = <h2>I am a SDE at Amazon</h2>

const incrementHandler = () =>{
  name += 1;
}

const Header = () => {
  return (
    <div className='header'>
    <h1>AR</h1>
    <div className='search-bar'><input placeholder='Search Item' />
    <button onClick={incrementHandler}>Search</button>
    </div></div>
  );
}

const Test = ({name}) => {
  return (
    <>
      <h1>Test Succesful: {name}</h1>
    </>
  );
}

function App() {
  return (
    <div className='Main'>
      <Header />
      <Test name = {name}/>
    </div>
  );
}

export default App;
